import { createStore } from "vuex";

export default createStore({
  state: {
    count: 1,
  },
  getters: {},
  mutations: {
    increment(state) {
      state.count++;
    },
    incrementBy() {
      this.$store.commit("increment");
    },
  },
  actions: {},
  modules: {},
});
